import React from "react";
import './Result.css';
import './OneHash';
import "https://cdnjs.cloudflare.com/ajax/libs/animejs/2.0.2/anime.min.js"

import Header from "./Header";

function getPWD(){ //récupération du mot de passe
    return localStorage.getItem("pwd");
}

function c(){
    src="https://cdnjs.cloudflare.com/ajax/libs/animejs/2.0.2/anime.min.js"
    let a = anime.timeline({
        loop: true
    });

    a.add({
        targets : '.PwdFound .word',
        scale: [14,1],
        opacity: [0,1],
        easing: "easeOutCirc",
        duration: 800,
        delay: (el, i) => 800 * i
    }).add({
        targets: '.PwdFound',
        opacity: 0,
        duration: 1000,
        easing: "easeOutExpo",
        delay: 1000
    });
}


function Result() {
    var pwd = getPWD();
    var c = c();
    return (
        <div className="App">
            <Header/>
        <header className="App-heade">
            <h1 class="PwdFound">
                <span class="word">PASSWORD</span>
                <span class="word">FOUND</span>
            </h1>
            <script src="https://cdnjs.cloudflare.com/ajax/libs/animejs/2.0.2/anime.min.js"></script>
            {c}
            <p>The result is : </p>
            {pwd}
        </header>
        </div>
    );
}

export default Result;
